import React from 'react';
import './experience.css'


function Exp() {
  return (
    <div className="Exp">
      <expr className='lange' >
      <article className='experience_detail'>
        <a>c++: 3 years study</a>
        <small className='text-light'>Experienced</small>
      </article>
        <v>python: 2 years study</v>
        <c>oracle sql: 1 year study</c>
        <d>javascript: 1 year study</d>
      </expr>

            
    </div>
  );
}

export default Exp;
